import React from "react";

import "./ExpensesFilter.css";

const ExpensesFilter = () => {
  const yearSelectedHandler = (event) => {
    console.log(event);
  };

  return (
    <div className="expenses-filter">
      <div className="expenses-filter__control">
        <label>Filter by year</label>
        <select>
          <option value="2022" onSelect={yearSelectedHandler}>
            2022
          </option>
          <option value="2021" onSelect={yearSelectedHandler}>
            2021
          </option>
          <option value="2020" onSelect={yearSelectedHandler}>
            2020
          </option>
          <option value="2019" onSelect={yearSelectedHandler}>
            2019
          </option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
